@megamissnortheast || Exploring India’s North East Paradise Unexplored with Mega Miss North East Finalist Deity Brahma Wahry from Assam

Supported by - 
Ministry Of Tourism, Government Of India, North East.

“The park is named after Sikhna Jwhwlao, a legendary Bodo hero known as Jaolia Dewan, who ruled the region and fought during the Duwar War between Bhutan and the East India Company, which took place around 1864-66, against British forces. His capital, Sikhnajhar (Chiknajhar-Nou Nwgwr), was located at Ultapani reserve forest, near Sarbhang, an Indo-Bhutan border town that is now within Sikhna Jwhwlao National Park.”

