Supported by - 
Ministry Of Tourism, Government Of India, North East.

“Sikkim is a small state located in the northeastern part of India, known for its stunning landscapes, including the Himalayan mountains, lush forests, and serene lakes. It is India's least populous state and is bordered by Nepal, Bhutan, and Tibet (China). Sikkim is famous for its rich biodiversity, Tibetan culture, and as a popular destination for trekking, wildlife enthusiasts, and those seeking peaceful retreats. Its capital is Gangtok, and the state has a strong focus on sustainable tourism and environmental preservation.”

